import { instance } from "./axios.util"

export const getPboardRead=(pcode)=>{
    return instance({
        url:`/pboard/${pcode}`,
        method:'get'
    })
}

export const onPboardUpdate=(formData)=>{
    return instance({
        url:'/pboard/update',
        method:'post',
        data:formData
    })
}
